How to solve Cloudflare Challenge page

You should intercept the turnstile.render call and grab the following values:

cData
chlPageData
action

Also you will need to intercept the callback definition and use the userAgent returned from our API.

To intercept the required parameters you can inject the following JavaScript on page before the Turnstile widget is loaded.

// inject.js
console.clear = () => console.log('Console was cleared');
const i = setInterval(() => {
  if (window.turnstile) {
    clearInterval(i);
    window.turnstile.render = (a, b) => {
      let params = {
        sitekey: b.sitekey,
        pageurl: window.location.href,
        data: b.cData,
        pagedata: b.chlPageData,
        action: b.action,
        userAgent: navigator.userAgent,
        json: 1,
      };
      // we will intercept the message in puppeeter
      console.log('intercepted-params:' + JSON.stringify(params));
      window.cfCallback = b.callback;
      return;
    };
  }
}, 50);
